// Función para validar los datos de los equipos
function validateEquipo(data) {
  const errors = [];
  if (!data.nombreMaximo || typeof data.nombreMaximo !== 'string') {
    errors.push(`El nombre máximo es requerido y debe ser una cadena.`);
  }
  if (!data.name || typeof data.name !== 'string') {
    errors.push(`El nombre es requerido y debe ser una cadena.`);
  }
  if (!data.zonaId || typeof data.zonaId !== 'number') {
    errors.push(`El ID de la zona es requerido y debe ser un número.`);
  }
  if (!data.ubicacionId || typeof data.ubicacionId !== 'number') {
    errors.push(`El ID de la ubicación es requerido y debe ser un número.`);
  }
  return errors;
}

